import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <input type="button" value="Click Me"></input>
        <element onclick="http://127.0.0.1:3000/tables">Click</element>
      </header>
    </div>
  );
}

export default App;
